int number_initial_y = 180;

int frog_x[MAX];
int frog_y[MAX];

int frog_y_offset = 28; //distance between frog's head and rock

/* Declare volatile pointers to I/O registers (volatile means that IO load
    and store instructions will be used to access these pointer locations,
    instead of regular memory loads and stores) */

    //** Initiallize VGA **//
  volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
  /* Read location of the pixel buffer from the pixel buffer controller */
  
  //** Initialize PS2 **//
	volatile int * PS2_ptr = (int *) PS2_BASE;  // PS/2 port address

  int  PS2_data, RVALID;
  char byte1 = 0, byte2 = 0, byte3 = 0;

//** Initialize Audio **//
  struct audio_t {
    volatile unsigned int control;  // The control/status register
    volatile unsigned char rarc;    // the 8 bit RARC register
    volatile unsigned char ralc;    // the 8 bit RALC register
    volatile unsigned char wsrc;    // the 8 bit WSRC register
    volatile unsigned char wslc;    // the 8 bit WSLC register
    volatile unsigned int ldata;    // the 32 bit (really 24) left data register
    volatile unsigned int rdata;  // the 32 bit (really 24) right data register
  };

  /* we don't need to 'reserve memory' for this, it is already there
           so we just need a pointer to this structure  */

  struct audio_t *const audiop = ((
      struct audio_t *)AUDIO_BASE);  // const after the asterisk applies to the
                                     // pointer itself, meaning it will always
                                     // point to the same memory address



//************************ Function Declaration ************************//
// Game Logic Function Declaration //
void clear_array();
void initialize_array(int num_stones);
void print_array();
void print_game_state();
int validate_move(int frog_to_move);
int make_move(int to_move, int move, volatile int *pixle_ctrl_ptr);
int get_input();
bool check_win();
bool check_lose();
void tutorial_mode();

// PS2 Keyboard Function Declaration//
int input_mux(char key_byte);

// Audio Function Deckartion //
void audio_playback_mono(const int *samples, int n);

// Timer Function Delcartion //

//************************ END of Declaration ************************//


int main(void) {

  // PS/2 mouse needs to be reset (must be already plugged in)
  *(PS2_ptr) = 0xFF; // reset
                    
  audiop->control = 0x8; // clear the output FIFOs
  audiop->control = 0x0; // resume input conversion

    /* set front pixel buffer to Buffer 1 */
  *(pixel_ctrl_ptr + 1) = (int)&Buffer1;  // first store the address in the back buffer
  pixel_buffer_start = *(pixel_ctrl_ptr + 1);
  
  draw_background();
  *pixel_ctrl_ptr = 1;
  wait_for_vsync();
  
  /* now, swap the front/back buffers, to set the front buffer location */
  *(pixel_ctrl_ptr + 1) = (int)&Buffer2;
  pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
  
  draw_background();
  draw_start_message(start_message_x, start_message_y);
  *pixel_ctrl_ptr = 1;
  wait_for_vsync();

  clear_array();
  initialize_array(DEFAULT);

  while(input_mux(byte3) != START){
    PS2_data = *(PS2_ptr);        // read the Data register in the PS/2 port
    RVALID   = PS2_data & 0x8000; // extract the RVALID field
      if (RVALID) {
          /* shift the next data byte into the display */
          byte1 = byte2;
          byte2 = byte3;
          byte3 = PS2_data & 0xFF;

          if ((byte2 == (char)0xAA) && (byte3 == (char)0x00))
              // mouse inserted; initialize sending of data
              *(PS2_ptr) = 0xF4;
      }
  }
  
  erase_start_message(start_message_x, start_message_y);

   while (1) {
    print_game_state();
    //int to_move = get_input();
    *pixel_ctrl_ptr = 1;
    wait_for_vsync();  // swap front and back buffers on VGA vertical sync
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // new back buffer
    
	  PS2_data = *(PS2_ptr);        // read the Data register in the PS/2 port
    RVALID   = PS2_data & 0x8000; // extract the RVALID field
    if (RVALID) {
      /* shift the next data byte into the display */
      byte1 = byte2;
      byte2 = byte3;
      byte3 = PS2_data & 0xFF;

      if ((byte2 == (char)0xAA) && (byte3 == (char)0x00))
      // mouse inserted; initialize sending of data
      *(PS2_ptr) = 0xF4;
    }
    int to_move = input_mux(byte3);
    byte1 = 0x00;
    byte2 = 0x00;
    byte3 = 0x00;
	  
    //printf("You haved selected %d\n", to_move);
    if (to_move == -1) {  // mistake restart the game
      initialize_array(g_num_stones);
      continue;
    }

    int move = validate_move(to_move);
    // printf("Player move is %d\n", move);
    if (move == 0) {
      continue;  // don't make a change
    } else {
      make_move(to_move, move, pixel_ctrl_ptr);
      print_game_state();
      // need to clean up
      // *pixel_ctrl_ptr = 1;
      // wait_for_vsync();  // swap front and back buffers on VGA vertical sync
      // pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // new back buffer
      // print_game_state();
      // *pixel_ctrl_ptr = 1;
      // wait_for_vsync();  // swap front and back buffers on VGA vertical sync
      // pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // new back buffer
    }
    
    if (check_win()) {

      draw_restart_message(start_message_x, 50);
      *pixel_ctrl_ptr = 1;
      wait_for_vsync();  // swap front and back buffers on VGA vertical sync
      pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // new back buffer

      audio_playback_mono(win_sound, 16320);

      // press Enter to start again
      while(input_mux(byte3) != NEXT){
        PS2_data = *(PS2_ptr);        // read the Data register in the PS/2 port
        RVALID   = PS2_data & 0x8000; // extract the RVALID field
        if (RVALID) {
            /* shift the next data byte into the display */
            byte1 = byte2;
            byte2 = byte3;
            byte3 = PS2_data & 0xFF;

            if ((byte2 == (char)0xAA) && (byte3 == (char)0x00))
                // mouse inserted; initialize sending of data
                *(PS2_ptr) = 0xF4;
        }
      }

      // erase message if next is requested
      *pixel_ctrl_ptr = 1;
      wait_for_vsync();  // swap front and back buffers on VGA vertical sync
      pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // new back buffer

      erase_next_level_message(start_message_x, 50);
      //printf("now! try a more difficult one!\n");
      
      initialize_array(g_num_stones);
	
      continue;

    } else if (check_lose()) {
      draw_lose_message(start_message_x, 40);
      draw_enter_tut_message(exit_message_x - 20, exit_message_y);
      *pixel_ctrl_ptr = 1;
      wait_for_vsync();  // swap front and back buffers on VGA vertical sync
      pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // new back buffer

      while(input_mux(byte3) != -1 && byte3 != 0x2C){ // 0x2C is key T for tutorial mode
        PS2_data = *(PS2_ptr);        // read the Data register in the PS/2 port
        RVALID   = PS2_data & 0x8000; // extract the RVALID field
        if (RVALID) {
            /* shift the next data byte into the display */
          byte1 = byte2;
          byte2 = byte3;
          byte3 = PS2_data & 0xFF;

          if ((byte2 == (char)0xAA) && (byte3 == (char)0x00))
          // mouse inserted; initialize sending of data
          *(PS2_ptr) = 0xF4;
        }
      }

      // erase message if next is requested
      *pixel_ctrl_ptr = 1;
      wait_for_vsync();  // swap front and back buffers on VGA vertical sync
      pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // new back buffer

      erase_lose_message(start_message_x, 40);
      erase_enter_tut_message(exit_message_x - 20, exit_message_y);

      if (input_mux(byte3) == -1) {
        initialize_array(g_num_stones);
      } else if (byte3 == 0x2C) {
        clear_background();
        tutorial_mode();
        continue;
      }
    } 
  }
  draw_win_message(start_message_x, 50);
  *pixel_ctrl_ptr = 1;
  wait_for_vsync();  // swap front and back buffers on VGA vertical sync
  pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // new back buffer

  draw_win_message(start_message_x, 50);
  *pixel_ctrl_ptr = 1;
  wait_for_vsync();  // swap front and back buffers on VGA vertical sync
  pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // new back buffer

  return 0;
}

