//***** Animations *****//
void animate_left_big_jump(int to_move, volatile int *pixel_ctrl_ptr){
  int distance = frog_x[to_move + 2] - frog_x[to_move];
  int dx = 1;
  int dy = 1;

  int current_x = frog_x[to_move];
  int current_y = frog_y[to_move];
  int prev2_x = current_x;
  int prev2_y = current_y;
  int prev_x = current_x;
  int prev_y = current_y;
  int prev_dy = 0;

  for (int i = 0; i <= distance; i++) {
    draw_empty_frog(prev2_x, prev2_y);
    draw_left_jumping_frog(current_x, current_y);
    //dy = (1/50 * (i - 3.4) * (i - 3.4) + 4) - prev_dy;
    //prev_dy = dy;
	  
	  dy = 2;
	  
    prev2_x = prev_x;
    prev2_y = prev_y;
    prev_x = current_x;
    prev_y = current_y;
	
	if(current_y < 125 && current_x < frog_x[to_move] + distance/2 + 15) {dy = 1;}
	  
    if(i <= distance/2){
      current_x += dx;
      current_y -= dy;
    }else{
      current_x += dx;
      current_y -= -dy;
    }
    *pixel_ctrl_ptr = 1;
    wait_for_vsync();  // swap front and back buffers on VGA vertical sync
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // new back buffer
  }

  //erasing the last two
  draw_empty_frog(prev2_x, prev2_y);
  *pixel_ctrl_ptr = 1;
  wait_for_vsync();  // swap front and back buffers on VGA vertical sync
  pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // new back buffer

  draw_empty_frog(prev_x, prev_y);
  *pixel_ctrl_ptr = 1;
  wait_for_vsync();  // swap front and back buffers on VGA vertical sync
  pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // new back buffer
}

