    //dy = (1/50 * (i - 3.4) * (i - 3.4) + 4) - prev_dy;
    //prev_dy = dy;
	  
    prev2_x = prev_x;
    prev2_y = prev_y;
    prev_x = current_x;
    prev_y = current_y;
	
	//if(current_y < 125 && current_x < frog_x[to_move] + distance/2 + 19) {dy = 0;}
	  
    if(i <= distance/2){
      current_x += dx;
      current_y -= dy;
    }else{
      current_x += dx;
      current_y -= -dy;
    }

    *pixel_ctrl_ptr = 1;
    wait_for_vsync();  // swap front and back buffers on VGA vertical sync
